class supermarket:    arr=[]    def create(self,val):        self.arr.append(val)    def display(self):        for i in self.arr:            print(i)    def search(self,key):        rslt=''        for i in self.arr:            if i['name']==key:                rslt=i        if len(rslt)==0:            return 'not found'        else:            return rslt    def delete(self,key):        index=-1        for i in range(len(self.arr)):            if self.arr[i]['name']==key:                index=i        if index != -1:            self.arr.pop(index)            print('delete success')        else:            print('not found and delete failed')